import React from 'react'

const Bikes= ({bikes, loading}) => {

    if(loading){
        return <h2>Loading...</h2>
    }

    return (
        <div>
            <ul>
                {
                    bikes.map(bike => (
                        <li key={bike.id}>
                            {bike.title}
                        </li>
                    ))
                }
            </ul>
        </div>
    )
}

export default Bikes
